import FormSearch from './FormSearch';

function App() {

  const styles = {
     h1: {
       marginLeft: '2rem'
     },
     header: {
       display: 'flex',
       flexDirection: 'row',
       alignItems: 'space-between'
     }
  }

  return (
    <div>
      <header style={styles.header}>
        <h1 style={styles.h1}>Picture Search</h1>
        <FormSearch />
      </header>
    </div>
  );
}

export default App;
